import Nav from './Nav';
import Link from 'next/link';
import styled from 'styled-components';


const Header = () => (
    <div>
        <div className="bar">
            <h1>
              <Link href="/">
                <a>Prospectable!</a>
              </Link>  
            </h1>
            <Nav />
        </div>
        <div className="sub-bar">
            <p>Search</p>
        </div>
        <div>ToCall</div>
    </div>
);

export default Header;
